import React, { Component } from 'react';
import {login} from '../login/login-api'
import {
    Form,
    Input,
    Tooltip,
    Icon,
    Cascader,
    Select,
    Row,
    Col,
    Checkbox,
    Button,
    AutoComplete,
  } from 'antd';

const FormItem = Form.Item;

class Login extends Component {
    render() {
        const AntWrappedLoginForm = Form.create()(LoginForm);
        return (
            <AntWrappedLoginForm onLogin={this.props.onLogin}/>           
        );
    }
}

class LoginForm extends Component  {
    constructor(props) {
        super(props);
        this.onSubmitExperience = this.onSubmitExperience.bind(this);

    }

    onSubmitExperience = (e) => {
        e.preventDefault();

        this.props.form.validateFields((err, values) => {
            if (!err) {
                const loginRequest = Object.assign({}, values);
                console.log(values);
                let loginRequests=values;
                console.log(loginRequest);
                loginRequest.data={};
                console.log(loginRequest);
                // console.log(loginRequests.username);
                // console.log(loginRequests.password);


                // login(loginRequest)
                //     .then(response => {
                //         initiateUser(response.access_token);
                //         this.props.onLogin();
                //     })
                //     .catch(error => {
                //         if (error.status === 401 || (error.error_description === 'Bad credentials')) {
                //             notification.error({
                //                 message: APP_NAME,
                //                 description:
                //                     'Your Username or Password is incorrect. Please try again!'
                //             });
                //         } else {
                //             notification.error({
                //                 message: APP_NAME,
                //                 description:
                //                     error.message ||
                //                     'Sorry! Something went wrong. Please try again!'
                //             });
                //         }
                //     });
            }
        });
    }

  render() {
    const {getFieldDecorator} = this.props.form;

    return (
        <div className="bg-dark" 
        style={{height: "100vh", display: "flex", alignItems: "center",justifyContent: "center"}}>
            <div className="bg-dark sufee-login d-flex align-content-center flex-wrap" style={{height:"100%", width:"100%"}}>
                <div className="container">
                    <div className="login-content">
                        <div className="login-logo">
                            <a href="index.html">
                                <img className="align-content" src="/images/logo.png" alt="" />
                            </a>
                        </div>
                        <div className="login-form">
                            <form onSubmit={this.onSubmitExperience}>
                                <div className="row">
                                    <div className="col-md-12">
                                        <FormItem>
                                            {getFieldDecorator('email', {
                                                rules: [
                                                    {
                                                        required: true,
                                                        message: 'Please input your email!'
                                                    }
                                                ]
                                            })(
                                                <Input
                                                    className="form-control"
                                                    prefix={<Icon type="user"/>}
                                                    name="username"
                                                    placeholder=" Email"
                                                />
                                            )}
                                        </FormItem>
                                    </div>
                                </div>


                                <div className="row">
                                    <div className="col-md-12">
                                        <FormItem>
                                            <label>Password</label>
                                            {getFieldDecorator('password', {
                                                rules: [
                                                    {
                                                        required: true,
                                                        message: 'Please input your Password!'
                                                    }
                                                ]
                                            })(
                                                <Input
                                                    prefix={<Icon type="lock"/>}
                                                    name="password"
                                                    type="password"
                                                    placeholder="Password"
                                                />

                                            )}
                                        </FormItem> 
                                    </div>
                                </div>

                                <FormItem>
                                    <button type="submit" className="btn btn-primary btn-flat m-b-30 m-t-30">Register</button>
                                </FormItem>                                        
                                <div className="register-link m-t-15 text-center">
                                    <p>Already have account ? <a href="#"> Sign in</a></p>
                                </div>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
  }
}

export default Login;
